import React from 'react';

const UserDetails = () => {
  const textStyle = {
    color: '#FFF',
  };

  return (
    <div style={textStyle}>
      <p>Masters from Arizona State University</p>
      <p>Email: example@example.com</p>
      <p>Phone: +1234567890</p>
      <p>Hobby: [Your hobby]</p>
    </div>
  );
};

export default UserDetails;
